import { FaCss3Alt } from "react-icons/fa";

export default function Skills() {
  return (
    <div className="skills">
      <div className="skills-wrapper">
        <div className="skills-overlay"></div>
        <div className="skills-icon">
          <i className="fa fa-git-square"></i>
        </div>
        <div className="skills-icon">
          <i className="fa fa-github"></i>
        </div>
        <div className="skills-icon">
          <i className="fa fa-html5"></i>
        </div>
        <div className="skills-icon">
          <i className={FaCss3Alt}></i>
        </div>
        <div className="skills-icon">
          <i className="fa fa-js"></i>
        </div>
        <div className="skills-icon">
          <i className="fa">&#xf41b;</i>
        </div>
        <div className="skills-icon">
          <i className="fab fa-node-js"></i>
        </div>

        <div className="project">
          <div className="skills-icon">
            <a href="https://www.a-ztechnics.be">Project</a>
          </div>
          <span className="space"></span>
          <div className="skills-icon">
            <a href="#">Github </a>
          </div>
        </div>
      </div>
      <style jsx>{`
        .skills-wrapper {
          width: 800px;
          height: 400px;
          position: absolute;
          background-color: rgb(145, 139, 139);
          transform: translate(-125%, -80%);
          opacity: 0.5;
          border-radius: 50px;
          display: flex;
          justify-content: space-evenly;
          align-items: center;
        }
        .skills-icon {
          position: relative;
          color: white;
          z-index: 1000%;
          font-size: large;
          border: 1px solid rgb(250, 246, 246);
          background-color: rgb(17, 17, 17);
          width: 100px;
          height: 100px;
          border-radius: 50%;
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .project {
          position: absolute;
          display: flex;
          flex-direction: row;
          width: 100%;
          justify-content: center;
          padding-top: 30px;
          transform: translate(0%, 80%);
        }
        .space {
          margin: 20px;
        }
      `}</style>
    </div>
  );
}
